import "./match.css"

function Match(index) {
  // addPlayers = (props, key) => {
  //   return (
  //     <div className="player" key={key}>
  //       <div className="player-name">{props.id}</div>
  //       <img className="player-photo" src={props.photo} />
  //     </div>
  //   );
  // }

  var matchInfo = [
    {
      date: "2023-04-01",
      tine: "18:00UTC",
      team1: "Dplus",
      team2: "SANDBOX"
    }
  ]

  return (
    <div id="teams">
      <div id="section-name">
        <div className="dividing-line"></div>
        <p>Match</p>
        <div className="dividing-line"></div>
      </div>
      <div id="wrap">
        <div id="teams-body">
          <div id="title">
            <p>DATE</p>
            <p>TIME</p>
            <p>MATCH</p>
          </div>
          <div id="matches">
            {map}
          </div>
        </div>
      </div>
    </div>
  )
}

export default Match;
